import React from 'react';
import classes from '../../css/Auth/Auth.module.css';

const Auth = (props) => {
    const onSubmit = (formData) => {
        console.log(formData);
    }

    return <div>
        <h1 className={ classes.page_title }>
            Авторизация
        </h1>
        <SignInReduxFor onSubmit={onSubmit} />
    </div>
}

export default Auth;
